import "./PlatformSidebar.scss";
import React from "react";
const autoBindReact = require('auto-bind/react');

export class PlatformSidebar extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
        };
        autoBindReact(this);
      }

  renderUser() {
    return (
      <div className="user-snippet-wrapper">
        <div className="user-snippet-photo"></div>
        <div className="user-snippet-name">
        </div>
      </div>
    );
  }

  renderDepartment(depName, user) {
      return( 
        <div className="sidebar-wrapper">
        <div className="sidebar-department">
            <div className="department">
            <div className="toggle-arrow"></div>
            <div className="dep-name">{depName}</div>
            </div>


        </div>
    </div>
      )

  }
  render() {
    return this.renderDepartment('Компания')
  }
}
